import React from "react";
import {Link} from "react-router-dom";
import AuthOptions from "../common/AuthOptions";

export default function Header() {
    return (
        <header id="header">
            <Link to="/">
                <h1 className="title">Year 4 Project</h1>
            </Link>
            <AuthOptions />
        </header>
    );
}
